import React from "react";
import { AiFillCaretLeft, AiFillCaretRight } from "react-icons/ai";

const Projects = () => {
  const projects = [
    { id: 1, name: "AHSAN" },
    { id: 2, name: "MOHSIN" },
  ];
  return (
    <div className="projects">
      <h1>Projects</h1>

      <button>
        <AiFillCaretLeft />
      </button>
      {projects.map((project, index) => (
        <div key={index}>
          <p>{project.id}</p>
          <p>{project.name}</p>
        </div>
      ))}
      <button>
        <AiFillCaretRight />
      </button>
    </div>
  );
};

export default Projects;
